    {
        var instanceFleetProvisioningSpecificationsResult = CreateInstanceFleetProvisioningSpecifications();
        factoryAction?.Invoke(instanceFleetProvisioningSpecificationsResult);

        return instanceFleetProvisioningSpecificationsResult;
    }

    private Humidifier.EMR.ClusterTypes.InstanceFleetProvisioningSpecifications CreateInstanceFleetProvisioningSpecifications()
    {
