        return instanceFleetProvisioningSpecificationsResult;
    }
    public override void CreateChildren(Humidifier.EMR.ClusterTypes.InstanceFleetProvisioningSpecifications result)
    {
        base.CreateChildren(result);

        result.OnDemandSpecification ??= OnDemandSpecificationFactory?.Build();
        result.SpotSpecification ??= SpotSpecificationFactory?.Build();
    }

